import React from "react";
import { stack as Menu } from "react-burger-menu";
import { useState } from "react";

const Hamburger = () => {
	const [page, setPage] = useState(0);
	return (
		<Menu>
			<a id="Weather" className="burgerItem" onClick={() => setPage(2)}>
				Home
			</a>
			<a id="Weather" className="burgerItem" onClick={() => setPage(3)}>
				Weather
			</a>
			<a id="YourTour" className="burgerItem" onClick={() => setPage(4)}>
				Your Tour
			</a>
			<a id="Contact" className="burgerItem" onClick={() => setPage(5)}>
				Contact
			</a>
		</Menu>
	);
};

export default Hamburger;
